import './topbar.css'
import { Search } from '@mui/icons-material/rounded'

const TopBar = () => {
    return (  
        <div className="topbarContainer">
            <div className="topbarLeft">
                <span className="topbarLogo">WhatMedia</span>
            </div>
            <div className="topbarCenter">
                <input placeholder='Search...' className="topbarsearch" />
                <Search />
            </div>
            <div className="topbarRight"></div>
        </div>
    );
}

export default TopBar;
